import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Landing from './Landing';

function Router(){
    return(
        <BrowserRouter>
                <Route path='/' component={Landing}></Route>
        </BrowserRouter>
    );
}

export default Router;
